// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Crowdsale.sol";

//import "@openzeppelin/contracts/utils/math";

abstract contract Timestamp is Crowdsale {
    using SafeMath for uint256;

    uint256 public openTime;
    uint256 public closeTime;

    modifier onlyWhileOpen {
        require(block.timestamp >= openTime && block.timestamp <= closeTime);
        _;
    }

    constructor(uint256 _openingTime, uint256 _closingTime) {
        require(_openingTime >= block.timestamp);
        require(_closingTime >= _openingTime);

        openTime = _openingTime;
        closeTime = _closingTime;
    }

    function hasClosed() public view returns (bool) {
        return block.timestamp > closeTime;
    }
}
